import React from 'react';
import toDo from './ToDo';

function Task (props) {
    return (
        <div>
             <ol>
                    {this.state.tasks.map((task, index) => {
                        return <li key={index}>{task}</li>
                    })}
                </ol>
        </div>
    );
}

export default Task;
